// NoteDetailPage.js

import React from 'react';
import { useParams, Link } from 'react-router-dom';

const NoteDetailPage = () => {
  // Use the useParams hook to get the noteId from the URL
  const { noteId } = useParams();

  // Fetch the details of the note with the noteId and implement your logic
  // ...

  return (
    <div>
      <h2>Note Detail Page</h2>
      {/* Display note details and implement "edit" and "delete" options */}
      <p>Note ID: {noteId}</p>
      
      {/* Edit and Delete buttons */}
      <Link to={`/edit-note/${noteId}`}>
        <button>Edit</button>
      </Link>
      <button>Delete</button>
    </div>
  );
};

export default NoteDetailPage;
